import React from "react";
import { Carousel } from "react-responsive-carousel";

export default function RoomListCard({ data }) {
  const chunkedData = [];
  for (let i = 0; i < data.length; i += 4) {
    chunkedData.push(data.slice(i, i + 4));
  }

  return (
    <Carousel
      showThumbs={false}
      showStatus={false}
      showArrows={true}
      infiniteLoop={true}
      centerMode={true}
    >
      {chunkedData.map((chunk, index) => (
        <div
          key={index}
          style={{ display: "flex", justifyContent: "space-between" }}
        >
          {chunk.map((item, idx) => (
            <div key={idx}>
              <img
                src={item.image}
                alt={`slide-${idx}`}
                style={{ width: "200px", height: "400px" }}
              />
              <p>{item.text}</p>
            </div>
          ))}
        </div>
      ))}
    </Carousel>
  );
}
